  `geaendertAm` datetime DEFAULT NULL,
  `geaendertDurch` int(5) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

